  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC ADMIN RELEASE 34-68098, ACCOUNTING AND AUDITING ENFORCEMENT RELEASE 3420, OCTOBER 24, 2012: THE SECURITIES AND EXCHANGE COMMISSION (\"COMMISSION\") DEEMED IT APPROPRIATE AND IN THE PUBLIC INTEREST THAT PUBLIC ADMINISTRATIVE PROCEEDINGS BE INSTITUTED PURSUANT TO RULE 102(E)(3)1 OF THE COMMISSION'S RULES OF PRACTICE AGAINST RAJNISH K. DAS (\"RESPONDENT\" OR \"DAS\").  THE COMMISSION FOUND THAT FROM APPROXIMATELY SEPTEMBER 2003 THROUGH JANUARY 2006, DAS WAS EMPLOYED AS CHIEF FINANCIAL OFFICER (\"CFO\") OF A DATABASE MARKETING COMPANY. AS CFO, DAS SIGNED AND CERTIFIED THE COMPANY'S FORMS 10-K WHICH INCORPORATED INFORMATION FROM THE COMPANY'S PROXY STATEMENTS.  ON MAY 29, 2012, THE U.S. DISTRICT COURT FOR THE DISTRICT OF NEBRASKA ENTERED A FINAL JUDGMENT AGAINST DAS, PERMANENTLY ENJOINING HIM FROM FUTURE VIOLATIONS, DIRECT OR INDIRECT, OF SECTIONS 10(B), 13(A), 13(B)(2)(A), 13(B)(2)(B), 13(B)(5), AND 14(A) OF THE SECURITIES EXCHANGE ACT OF 1934 AND RULES 10B-5, 12B-20, 13A-1, 13A-13, 13A-14, 13B2-1, 13B2-2, 14A-3, AND 14A-9 THEREUNDER. SECURITIES AND EXCHANGE COMMISSION V. RAJNISH K. DAS, ET AL., CIVIL ACTION NUMBER 8:10-CV-00102-LSC-FG3. IN THE FINAL JUDGMENT, THE COURT DECLARED THAT DAS \"ACTED IN BAD FAITH TOWARD SHAREHOLDERS OF THE COMPANY, WHEN COMMITTING THE ACTS AND OMISSIONS THAT LED TO THIS PROCEEDING, AND KNEW HIS ACTIONS WERE CONTRARY TO THE INTERESTS OF THE COMPANY AND ITS SHAREHOLDERS.\"  PREVIOUSLY, ON MARCH 2, 2012, AFTER A TRIAL, A JURY FOR THE U.S. DISTRICT COURT FOR THE DISTRICT OF NEBRASKA, ISSUED A VERDICT FINDING DAS LIABLE FOR VIOLATIONS OF SECTIONS 10(B), 13(A), 13(B)(2)(A), 13(B)(2)(B), 13(B)(5), 14(A) OF THE EXCHANGE ACT AND RULES 10B-5, 12B-20, 13A-1, 13A-13, 13A-14, 13B2-1, 13B2-2, 14A-3, AND 14A-9 THEREUNDER. SECURITIES AND EXCHANGE COMMISSION V. RAJNISH K. DAS, ET AL., CIVIL ACTION NUMBER 8:10-CV-00102-LSC-FG3.  THE COMMISSION'S COMPLAINT ALLEGED THAT DAS SIGNED AND CERTIFIED THE COMPANY'S FALSE FORMS 10-K AND PROXY STATEMENTS THAT MATERIALLY UNDERSTATED AND FAILED TO PROPERLY DISCLOSE THE PERQUISITE COMPENSATION OF THE COMPANY'S FORMER CHIEF EXECUTIVE OFFICER AND CHAIRMAN OF THE BOARD OF DIRECTORS, AND FAILED TO PROPERLY DISCLOSE RELATED PARTY TRANSACTIONS. THE COMPLAINT ALLEGED THAT FOR THE YEARS 2003 THROUGH 2007, THE FORMER CEO USED THE COMPANY TO PAY FOR HIS PERSONAL EXPENSES ASSOCIATED WITH PRIVATE JET FLIGHTS, A YACHT, HOMES, AUTOMOBILES, CREDIT CARD EXPENSES, COUNTRY CLUB MEMBERSHIPS, AND LIFE INSURANCE POLICIES. AS CFO, DAS APPROVED THE COMPANY'S PAYMENT OF THE FORMER CEO'S PERSONAL EXPENSES AND SIGNED AND CERTIFIED THE COMPANY'S FALSE FORMS 10-K FOR 2003 AND 2004 WHICH INCORPORATED INFORMATION FROM THE COMPANY'S PROXY STATEMENTS. THE COMPLAINT ALSO ALLEGED THAT DAS AIDED AND ABETTED THE FILING OF THE COMPANY'S FALSE FORM 10-K FOR 2005 WHICH INCORPORATED INFORMATION FROM THE COMPANY'S PROXY STATEMENTS.",
