{
  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC LITIGATION RELEASE 21451, MARCH 15, 2010: THE SECURITIES AND EXCHANGE COMMISSION (COMMISSION) FILED A COMPLAINT AGAINST DEFENDANT RAJNISH K. DAS, ALLEGING VIOLATIONS OF SECTIONS 10(B), 13(B)(5), AND 14(A) OF THE SECURITIES EXCHANGE ACT OF 1934 (EXCHANGE ACT) AND RULES 10B-5, 13A-13, 13A-14, 13B2-1, 13B2-2, 14A-3, AND 14A-9 THEREUNDER, AND AIDING AND ABETTING VIOLATIONS OF SECTIONS 13(A), 13(B)(2)(A) AND 13(B)(2)(B) OF THE EXCHANGE ACT AND RULES 12B-20 AND 13A-1 THEREUNDER.  THE COMMISSION'S COMPLAINT ALLEGED THAT DAS AND OTHERS CAUSED HIS FIRM TO PAY ANOTHER DEFENDANT ALMOST $9.5 MILLION OF UNAUTHORIZED AND UNDISCLOSED PERQUISITES AND TO ENTER INTO $9.3 MILLION OF UNDISCLOSED RELATED PARTY TRANSACTIONS WITH HIS ENTITIES. THE COMMISSION ALSO ALLEGED THAT DAS ALLOWED ANOTHER DEFENDANT TO SUPPORT HIS LAVISH LIFESTYLE BY RUBBER-STAMPING HUNDREDS OF HIS EXPENSE REIMBURSEMENT REQUESTS. ACCORDING TO THE COMPLAINT, DAS APPROVED THE DEFENDANT'S EXPENSE REIMBURSEMENT REQUESTS DESPITE THE FACT THAT THE REQUESTS LACKED SUFFICIENT EXPLANATION OF BUSINESS PURPOSE AND SUPPORTING DOCUMENTATION, EVEN IN THE FACE OF CONCERNS RAISED BY SEVERAL FIRM EMPLOYEES. THE COMPLAINT ALLEGED THAT DAS KNEW, OR WAS RECKLESS IN NOT KNOWING, THAT THE FIRM'S COMMISSION FILINGS MATERIALLY UNDERSTATED THE DEFENDANT'S COMPENSATION AND FAILED TO DISCLOSE PROPERLY RELATED PARTY TRANSACTIONS WITH HIS ENTITIES. THE COMPLAINT FURTHER ALLEGED THAT DAS SIGNED MANAGEMENT REPRESENTATION LETTERS TO THE FIRM'S OUTSIDE AUDITOR THAT REPRESENTED FALSELY THAT ALL RELATED PARTY TRANSACTIONS HAD BEEN PROPERLY RECORDED AND DISCLOSED IN THE FIRM'S FINANCIAL STATEMENTS.",
  "Resolution" : "Judgment Rendered",
